import React, { Component } from 'react';
import { withCookies } from 'react-cookie';
import { Table } from 'antd';
import './WorkScheduleReportToPrint.style.scss';

const dataSource = [
  {
    key: '1',
    name: 'Mike',
    age: 32,
    address: '10 Downing Street',
  },
  {
    key: '2',
    name: 'John',
    age: 42,
    address: '10 Downing Street',
  },
];

const columns = [
  {
    title: 'Name',
    dataIndex: 'name',
    key: 'name',
  },
  {
    title: 'Age',
    dataIndex: 'age',
    key: 'age',
  },
  {
    title: 'Address',
    dataIndex: 'address',
    key: 'address',
  },
];

class WorkScheduleReportToPrint extends Component {
  render() {
    console.log(this.props.staffID);

    return (
      <div className="work-schedule-report-to-print">
        <Table dataSource={dataSource} columns={columns} />
      </div>
    )
  }
}
export default withCookies(WorkScheduleReportToPrint);
